Return documents that meet a Sub-query Result Set<p>I am trying to solve a problem that in Sql Server would require a common table expression or subquery.</p>

<p>I have a collection named Invoice_Details. Each document has an InvoiceID, CustomerID, TransactionDate and TransactionAmount field.</p>

<p>What I am looking to do is get back all of the document that when the TransactionAmount is aggregated, does not equal zero.</p>

<p>I am doing the grouping as follows:</p>

<pre><code>   db.Invoice_Details.aggregate(
   [
     {
       $group:
         {
           _id: { InvoiceID: "$InvoiceID"},
           Balance: { $sum: "$TransactionAmount"}
         }
     },
     { $match: { Balance: { $ne: 0 } } }
   ]
)
</code></pre>

<p>and this yields </p>

<pre><code>{
    "_id" : {
        "InvoiceID" : "234904"
    },
    "Balance" : 182.67
}
</code></pre>

<p>....  hundreds of additional documents which is great. </p>

<p>What I want to do now is get all of the invoice_details documents that were returned in the the aggregate.</p>

<p>In Sql Server, I would rejoin the results of the common table expression/subquery, but I'm not sure how (if?) I can do this mongo.</p>

