Mongoose: Using $or for Partial Match Across Multiple Fields<p>I have a MongoDB query that works fine in console for getting partial matches across several fields: </p>

<pre><code>db.Col.find({ "$or": [ { "product": /Su/}, { "location": /Su/ },{ "category": /Su/ } , { "owner": /Su/ }] })
</code></pre>

<p>I am using mongoose in my angular app and cannot figure out how to structure it to work. "filter" is the text coming in from my api call. </p>

<pre><code>exports.listPartialMatches = function(req, res) {
  var filter = req.params.filter;
  Col.find().or([ { "project": /filter/ }, { "location": /filter/ },{ "location": /filter/ } , { "owner": /filter/ }]).exec(function(err, mycol) {
    if (err) {
      return res.status(400).send({
        message: errorHandler.getErrorMessage(err)
      });
    } else {
      res.jsonp(mycol);
    }
  });
};
</code></pre>

<p>For some reason the above returns an empty array, whereas the console command does not. I have also tried "/" + filter + "/" and /filter/i but they all come back empty. </p>

<p>Is there something wrong with the actually find() call here or is it something with the structure of my strings for the partial match?</p>

