ASP.NET Web API and MongoDB Atlas - Method to Retrieve Specific Data from Database<p>I have created an ASP.NET Web API project (using .NET Framework 4.6.1) in Visual Studio Community Edition 2017 that utilizes MongoDb Atlas via the MongoDB .NET Driver. The project stores "Patients" with a few different attributes.</p>

<p>I have successfully implemented a Get() method to return a "Patient". I now want to implement a GetMedications() method to return only the medications of a particular "Patient". Below are the pertinent methods in my "PatientsController" file:</p>

<pre><code>public async Task&lt;Patient&gt; Get(string id)
{
    try
    {
        ObjectId internalId = GetInternalId(id);
        return await _patients.Find(p =&gt; p.Id == id || p.InternalId == internalId).FirstOrDefaultAsync();
    }
    catch (Exception ex)
    {
        throw ex;
    }
}

[Route("api/patients/{id}/medications")]
public async Task&lt;Medication&gt; GetMedications(string id)
{
    try
    {
        ObjectId internalId = GetInternalId(id);
        var patient = await _patients.Find(p =&gt; p.Id == id || p.InternalId == internalId).FirstOrDefaultAsync();
        return patient.Medications;
    }
    catch (Exception ex)
    {
        throw ex;
    }
}

private ObjectId GetInternalId(string id)
{
    ObjectId internalId;
    if (!ObjectId.TryParse(id, out internalId))
        internalId = ObjectId.Empty;

    return internalId;
}
</code></pre>

<p>Visual studio displays this error for <code>return patient.Medications</code>:</p>

<pre><code>Cannot implicitly convert type 'Systems.Collections.Generic.ICollection&lt;WebAPIDemo.Models.Medication&gt;' to 'WebAPIDemo.Models.Medication'
</code></pre>

<p>Here is my Patient class (and other applicable classes):</p>

<pre><code>public class Patient
{
    [BsonId]
    public ObjectId InternalId { get; set; }

    public string Id { get; set; }
    public string Name { get; set; }
    public ICollection&lt;Ailment&gt; Ailments { get; set; }
    public ICollection&lt;Medication&gt; Medications { get; set; }
}

public class Medication
{
    public string Name { get; set; }
    public int Doses { get; set; }
}

public class Ailment
{
    public string Name { get; set; }
}
</code></pre>

<p>How could I properly write the GetMedications() method?</p>

