How do you return mongodb info to the browser inside a hapi.js route handler?<p>I'm just getting started with hapi.js (^17.3.1) and mongodb (^3.0.7), and with asynchronous js code.  </p>

<p>Inside a route handler, I'm trying to retrieve data from the database.  As a test, I'm storing a string inside a variable "s" built by looping through database collection records.  The expected output to the browser is </p>

<blockquote>
  <p>start dbInfo1 dbInfo2 dbInfoN end</p>
</blockquote>

<p>I've tried various versions of this code: </p>

<pre><code>module.exports = {
    method: 'GET',
    handler: async function (request, reply) { 
        return await getRoutes();
    }       
}

async function getRoutes() {

    var s = "start";
    const mongo = require('mongodb').MongoClient;
    const mongoUrl = "mongodb://127.0.0.1:27017/";

    return // I'm returning this whole thing because hapi.js says it wants a promise. (500 error)
        await mongo.connect(mongoUrl)
        .then(function(client) {

            client.db("dbName").collection("collectionName")
            .find({})
            .forEach(function (record) {
                console.log(record.item);
                s += " | " + record.item;      
            });

            s + " end";  // But I've tried placing "return" here (500 error)

        });
        // I've also tried ".then(function(s) { return s + 'end' }) here but it seems to only have the same set of options/problems manifest.

        // I've also made it so that I place "return s + 'end'" here (displays "start end" with nothing in the middle).

}
</code></pre>

<p>I've tried placing the return statement in different places.  I either get an http 500 error in the console</p>

<blockquote>
  <p>Debug: internal, implementation, error<br>
  Error: handler method did not return a value, a promise, or throw an error<br>
  dbInfo1<br>
  dbInfo2<br>
  dbInfoN</p>
</blockquote>

<p>if I return the promise itself or from inside the promise, or I get </p>

<blockquote>
  <p>start end</p>
</blockquote>

<p>in the browser if I return from outside the promise.  </p>

<p>In either case, the console.log statement prints out the dbInfos output.</p>

<p>I've tried different placements, inclusions, and omissions of async and await with pretty much the same results.  I've also tried wrapping what is being returned inside getRoutes into an explicit Promise using "new Promise(...".  In this case, the console logs the dbInfos, but the browser hangs.</p>

<p>How do I await that "foreach" function before returning the variable s?</p>

